import React from "react";

interface TeaserProps {
    title: string;
    text: string;
    className?: string;
}

const Teaser: React.FC<TeaserProps> = ({ title, text, className = "" }) => {
    return (
        <div className={className}>
            <h2>{title}</h2>
            <p>{text}</p>
        </div>
    );
};

export default Teaser;
